function SignUp() {
	return (
		<div className=" bg-gray-300 mt-16 m-auto w-8/12 rounded-lg">
			<div className="p-2">
				<div className="flex-row">
					<div>
						LOGO
					</div>
					<div>
						Sign Up
					</div>
				</div>
			</div>
		</div>
	);
}

export default SignUp;
